"""
You are given an n x n binary matrix grid. You are allowed to change at most one 0 to be 1.

Return the size of the largest island in grid after applying this operation.

An island is a 4-directionally connected group of 1s.

 

Example 1:
Input: grid = [[1,0],[0,1]]
Output: 3
Explanation: Change one 0 to 1 and connect two 1s, then we get an island with area = 3.

Example 2:
Input: grid = [[1,1],[1,0]]
Output: 4
Explanation: Change the 0 to 1 and make the island bigger, only one island with area = 4.

Example 3:
Input: grid = [[1,1],[1,1]]
Output: 4
Explanation: Can't change any 0 to 1, only one island with area = 4.

Constraints:

n == grid.length
n == grid[i].length
1 <= n <= 500
grid[i][j] is either 0 or 1.
"""
import time

def timed(function):
    def wrapper(*args, **kwargs):
        before = time.perf_counter()  # High-precision timing
        value = function(*args, **kwargs)
        after = time.perf_counter()
        fname = function.__name__
        print(f"{fname} took {after - before:.8f} seconds to execute!")  # Format for better precision
        return value
    return wrapper
from typing import List
from collections import deque, defaultdict
class Solution:
    @timed
    def largestIsland(self, grid: List[List[int]]) -> int:

        """
        DFS SOLUTION

        n = len(grid)  # Grid size (n x n)
        island_id = 2  # Unique ID for each island (starting from 2)
        island_sizes = {}  # Dictionary to store island sizes {island_id: size}

        # DFS to explore an island, mark its ID, and calculate its size
        def dfs(row, col, isl_id):
            grid[row][col] = isl_id  # Mark current cell with island ID
            size = 1  # Initialize island size

            # Explore adjacent cells (up, down, left, right)
            if row > 0 and grid[row - 1][col] == 1:
                size += dfs(row - 1, col, isl_id)
            if col > 0 and grid[row][col - 1] == 1:
                size += dfs(row, col - 1, isl_id)
            if row < n - 1 and grid[row + 1][col] == 1:
                size += dfs(row + 1, col, isl_id)
            if col < n - 1 and grid[row][col + 1] == 1:
                size += dfs(row, col + 1, isl_id)

            return size

        # Assign unique IDs to islands and calculate their sizes
        for i in range(n):
            for j in range(n):
                if grid[i][j] == 1:  # Found a new island
                    island_size = dfs(i, j, island_id)
                    island_sizes[island_id] = island_size
                    island_id += 1  # Increment ID for next island

        # If there are no islands, return 1 (flipping any 0 would create an island)
        if not island_sizes:
            return 1

        max_island_size = max(island_sizes.values())  # Get the largest island size

        # Try flipping each water cell (0) to 1 and calculate the possible island size
        for i in range(n):
            for j in range(n):
                if grid[i][j] == 0:  # Only consider water cells
                    unique_adjacent_islands = set()  # Track unique neighboring islands
                    potential_size = 1  # Start with 1 (flipping this 0 to 1)

                    # Check all 4 possible neighbors (up, down, left, right)
                    if i > 0 and grid[i - 1][j] > 1:
                        island = grid[i - 1][j]
                        if island not in unique_adjacent_islands:
                            potential_size += island_sizes[island]
                            unique_adjacent_islands.add(island)

                    if i < n - 1 and grid[i + 1][j] > 1:
                        island = grid[i + 1][j]
                        if island not in unique_adjacent_islands:
                            potential_size += island_sizes[island]
                            unique_adjacent_islands.add(island)

                    if j > 0 and grid[i][j - 1] > 1:
                        island = grid[i][j - 1]
                        if island not in unique_adjacent_islands:
                            potential_size += island_sizes[island]
                            unique_adjacent_islands.add(island)

                    if j < n - 1 and grid[i][j + 1] > 1:
                        island = grid[i][j + 1]
                        if island not in unique_adjacent_islands:
                            potential_size += island_sizes[island]
                            unique_adjacent_islands.add(island)

                    max_island_size = max(max_island_size, potential_size)

        return max_island_size
        """
        # Helper function to use BFS to look for adjacent land and add it to union sets.
        def bfs(start: int)->None:
            queue = deque([start])
            while queue:                                                   
                for _ in range(len(queue)):  # Process level by level
                    node = queue.popleft()

                    for neighbor in [
                        node - n if node >= n else None,  # Up
                        node + n if node + n < nn else None,  # Down
                        node - 1 if node % n != 0 else None,  # Left
                        node + 1 if node % n != n - 1 else None,  # Right
                    ]:
                        if neighbor is not None and flat_grid[neighbor] == 1 and neighbor not in visited:
                            visited.add(neighbor)
                            queue.append(neighbor)
                            parent[neighbor] = parent[node]  
        
        # Variable definitions...
        n = len(grid)
        nn = n * n  
        parent = [i for i in range(nn)] # Track group membership
        flat_grid = [0] * nn    # Flatten grid to 1D array
        visited = set() # Track visited land cells for BFS
        water = set()   # Track water cells

        #Generate flattened grid
        for i in range(n):
            for j in range(n):
                flat_grid[n * i + j] = grid[i][j]

        if min(flat_grid) == max(flat_grid) == 1:
            return nn
        if min(flat_grid) == max(flat_grid) == 0:
            return 1

        # Iterate flattened grid, if land, kick off BFS (if not visited alreadY) if water, add to water set.
        for i in range(nn):
            if flat_grid[i] == 1 and i not in visited:
                bfs(i)
            elif flat_grid[i] == 0:
                water.add(i)

        # Track groups of land where parent: [land cells]
        land_groups = defaultdict(list)
        for i in range(nn):
            if i not in water:
                land_groups[parent[i]].append(i)


        # Iterate through water cells. Check if there are land groups to the north, south, east, or west of them.
        # Add the parent of each of those groups if they are.
        # Calculate the total size of each land group by referencing land_groups[parent].
        # Sum the total size of adjacent land groups and check if it is larger than the max land size seen.
        max_land_size = 0
        for w in water:
            top, bottom, left, right = (w - n), (w + n), (w - 1), (w + 1)
            islands=set()
            if top >=0 and parent[top] in land_groups:
                islands.add(parent[top])
            if bottom < nn and parent[bottom] in land_groups:
                islands.add(parent[bottom])
            if w % n != 0 and parent[left] in land_groups:
                islands.add(parent[left])
            if w % n != n-1 < nn and parent[right] in land_groups:
                islands.add(parent[right])
            size = 0
            for island in islands:
                size+=len(land_groups[island])
            max_land_size = max(max_land_size, size+1)

        return max_land_size

